import SiteLogo from "../../../assets/united-states-family-marketing-logo.webp";

export default function Logo() {
  return (
    <div className="">
      <img className="w-12 inline-block" src={SiteLogo} />
      <h1 className="ml-5 inline-block">US Family Marketing</h1>
    </div>
  );
}
